import React from 'react';
import '../css/dashboard.css';

export const Content=()=>{
    return(
        <div style={{display:'flex',alignContent:'center',justifyContent:'center'}}>
            <div className="main" style={{width:'95%',background:'red'}}>
                <div>
                    <ul>
                        <li>Stopwatch</li>
                        <li>tick</li>
                        <li>recycle</li>
                        <li>Double</li>
                    </ul>
                </div>
            </div>
        </div>
    )
}
